INSERT INTO Wo_Terms VALUES
("1","terms_of_use","<div class=\"_17ky _52ij _52id _3m9\">\n<div class=\"_1rf2\">\n<h2 class=\"_353a _52ip _52id _3m9\">Terms of Service</h2>\n<br /><br />HebeKind builds technologies and services that enable people to connect with each other, build communities and grow businesses. These Terms govern your use of HebeKind, Messenger and the other products, features, apps, services, technologies and software that we offer (theHebeKind ProductsorProducts), except where we expressly state that separate terms (and not these) apply. These Products are provided to you by HebeKind Platforms, Inc.<br /><br />We don\'t charge you to use HebeKind or the other products and services covered by these Terms. Instead, businesses and organisations pay us to show you ads for their products and services. By using our Products, you agree that we can show you ads that we think will be relevant to you and your interests. We use your personal data to help determine which ads to show you.<br /><br />We don\'t sell your personal data to advertisers, and we don\'t share information that directly identifies you (such as your name, email address or other contact information) with advertisers unless you give us specific permission. Instead, advertisers can tell us things such as the kind of audience that they want to see their ads, and we show those ads to people who may be interested. We provide advertisers with reports about the performance of their ads that help them understand how people are interacting with their content. See Section 2 below to learn more.<br /><br />OurData Policyexplains how we collect and use your personal data to determine some of the ads that you see and provide all of the other services described below. You can also go to yoursettingsat any time to review the privacy choices that you have about how we use your data.</div>\n</div>\n<div id=\"u_0_2_4P\" class=\"_3x93 _1-qq _52ii _3m9\">\n<div id=\"u_0_3_PB\" class=\"_t3o\">\n<div class=\"_17l6 _1-xl _17la\"></div>\n<div class=\"_t3q\"></div>\n</div>\n<h3 class=\"_3x94 _52io _3m9\">1. The services we provide</h3>\nOur mission is to give people the power to build community and bring the world closer together. To help advance this mission, we provide the products and services described below to you:\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_4_jC\" class=\"_3ma\">Provide a personalised experience for you:</div>\nYour experience on HebeKind is unlike anyone else\'s: from the posts, stories, events, ads and other content that you see in News Feed or our video platform to the HebeKind Pages that you follow and other features you might use, such as Trending, HebeKind Marketplace and search. We use the data that we have  for example, about the connections you make, the choices and settings you select, and what you share and do on and off our Products  to personalise your experience.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_5_a4\" class=\"_3ma\">Connect you with people and organisations that you care about:</div>\nWe help you find and connect with people, groups, businesses, organisations and others that matter to you across the HebeKind Products you use. We use the data we have to make suggestions for you and others  for example, groups to join, events to attend, HebeKind Pages to follow or send a message to, shows to watch and people you may want to become friends with. Stronger ties make for better communities, and we believe that our services are most useful when people are connected to people, groups and organisations that they care about.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_6_Y+\" class=\"_3ma\">Empower you to express yourself and communicate about what matters to you:</div>\nThere are many ways to express yourself on HebeKind and to communicate with friends, family and others about what matters to you  for example, sharing status updates, photos, videos and stories across the HebeKind Products that you use, sending messages to a friend or several people, creating events or groups, or adding content to your profile. We have also developed, and continue to explore, new ways for people to use technology, such as augmented reality and 360 video to create and share more expressive and engaging content on HebeKind Products.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_7_BL\" class=\"_3ma\">Help you discover content, products and services that may interest you:</div>\n<a id=\"discover-content\" href=\"https://www.facebook.com/legal/terms?cquick=jsc_c_p&amp;cquick_token=AQ53IPuei-QF4e5oXfw&amp;ctarget=https%3A%2F%2Fwww.facebook.com\"></a>We show you ads, offers and other sponsored content to help you discover content, products and services that are offered by the many businesses and organisations that use HebeKind and other HebeKind Products. Section 2 below explains this in more detail.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_8_nZ\" class=\"_3ma\">Combat harmful conduct, and protect and support our community:</div>\nPeople will only build community on HebeKind if they feel safe. We employ dedicated teams around the world and develop advanced technical systems to detect misuse of our Products, harmful conduct towards others and situations where we may be able to help support or protect our community. If we learn of content or conduct like this, we will take appropriate action  for example, offering help, removing content, removing or restricting access to certain features, disabling an account or contacting law enforcement. We share data with otherHebeKind Companieswhen we detect misuse or harmful conduct by someone using one of our Products.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_9_HA\" class=\"_3ma\">Use and develop advanced technologies to provide safe and functional services for everyone:</div>\nWe use and develop advanced technologies such as artificial intelligence, machine learning systems and augmented reality so that people can use our Products safely regardless of physical ability or geographic location. For example, technology such as this helps people who have visual impairments understand what or who is in photos or videos shared on HebeKind or Instagram. We also build sophisticated network and communication technology to help more people connect to the Internet in areas with limited access. And we develop automated systems to improve our ability to detect and remove abusive and dangerous activity that may harm our community and the integrity of our Products.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_a_7l\" class=\"_3ma\">Research ways to make our services better:</div>\nWe engage in research to develop, test and improve our Products. This includes analysing the data we have about our users and understanding how people use our Products, for example by conducting surveys and testing and troubleshooting new features. OurData Policyexplains how we use data to support this research for the purposes of developing and improving our services.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_b_zm\" class=\"_3ma\">Provide consistent and seamless experiences across the HebeKind Company Products:</div>\nOur Products help you find and connect with people, groups, businesses, organisations and others that are important to you. We design our systems so that your experience is consistent and seamless across the differentHebeKind Company Productsthat you use. For example, we use data about the people you engage with on HebeKind to make it easier for you to connect with them on Instagram or Messenger, and we enable you to communicate with businesses that you follow on HebeKind through Messenger.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_c_bL\" class=\"_3ma\">Enable global access to our services:</div>\nTo operate our global service, we need to store and distribute content and data in our data centres and systems around the world, including outside your country of residence. This infrastructure may be operated or controlled by HebeKind Platforms, Inc., HebeKind Platforms Ireland Limited or its affiliates.</div>\n</div>\n</div>\n<div id=\"u_0_d_hd\" class=\"_3x93 _1-qr _52ii _3m9\">\n<div id=\"u_0_e_hR\" class=\"_t3o\">\n<div class=\"_17l6 _1-xl _17la\"></div>\n<div class=\"_t3q\"></div>\n</div>\n<h3 class=\"_3x94 _52io _3m9\">2. How our services are funded</h3>\nInstead of paying to use HebeKind and the other products and services we offer, by using the HebeKind Products covered by these Terms, you agree that we can show you ads that businesses and organisations pay us to promote on and off theHebeKind Company Products. We use your personal data, such as information about your activity and interests, to show you ads that are more relevant to you.\n<div class=\"mvm uiP fsm\"></div>\nProtecting people\'s privacy is central to how we\'ve designed our ad system. This means that we can show you relevant and useful ads without telling advertisers who you are. We don\'t sell your personal data. We allow advertisers to tell us things such as their business goal, and the kind of audience that they want to see their ads (for example, people between the ages of 18-35 who like cycling). We then show their ad to people who might be interested.\n<div class=\"mvm uiP fsm\"></div>\nWe also provide advertisers with reports about the performance of their ads to help them understand how people are interacting with their content on and off HebeKind. For example, we provide general demographic and interest information to advertisers (for example, that an ad was seen by a woman between the ages of 25 and 34 who lives in Madrid and likes software engineering) to help them better understand their audience. We don\'t share information that directly identifies you (information such as your name or email address that by itself can be used to contact you or identifies who you are) unless you give us specific permission. Learn more about how HebeKind ads workhere.\n<div class=\"mvm uiP fsm\"></div>\nWe collect and use your personal data in order to provide the services described above for you. You can learn about how we collect and use your data in ourData Policy. You have controls over the types of ads and advertisers you see, and the types of information we use to determine which ads we show you.Learn more.</div>\n<div id=\"u_0_f_Wv\" class=\"_3x93 _1-qt _52ii _3m9\">\n<div id=\"u_0_g_6D\" class=\"_t3o\">\n<div class=\"_17l6 _1-xl _17la\"></div>\n<div class=\"_t3q\"></div>\n</div>\n<h3 class=\"_3x94 _52io _3m9\">3. Your commitments to HebeKind and our community</h3>\nWe provide these services to you and others to help advance our mission. In exchange, we need you to make the following commitments:\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_h_dg\" class=\"_3ma\">1. Who can use HebeKind</div>\nWhen people stand behind their opinions and actions, our community is safer and more accountable. For this reason, you must:\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">use the same name that you use in everyday life;</div>\n</li>\n<li>\n<div class=\"fcb\">provide accurate information about yourself;</div>\n</li>\n<li>\n<div class=\"fcb\">create only one account (your own) and use your timeline for personal purposes; and</div>\n</li>\n<li>\n<div class=\"fcb\">not share your password, give access to your HebeKind account to others or transfer your account to anyone else (without our permission).</div>\n</li>\n</ul>\n<div class=\"mvm uiP fsm\"></div>\nWe try to make HebeKind broadly available to everyone, but you cannot use HebeKind if:\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">You are under 13 years old (or the minimum legal age in your country to use our Products).</div>\n</li>\n<li>\n<div class=\"fcb\">You are a convicted sex offender.</div>\n</li>\n<li>\n<div class=\"fcb\">We\'ve previously disabled your account for violations of our Terms or Policies.</div>\n</li>\n<li>\n<div class=\"fcb\">You are prohibited from receiving our products, services or software under applicable laws.</div>\n</li>\n</ul>\n</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_i_/D\" class=\"_3ma\">2. What you can share and do on HebeKind Products</div>\nWe want people to use HebeKind Products to express themselves and to share content that is important to them, but not at the expense of the safety and well-being of others or the integrity of our community. You therefore agree not to engage in the conduct described below (or to facilitate or support others in doing so):\n<ol>\n<li>You may not use our Products to do or share anything:\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">That violates these Terms, ourCommunity Standardsand<u>other terms and policies</u>that apply to your use of our Products.\n<div class=\"mvm uiP fsm\"></div>\n</div>\n</li>\n<li>\n<div class=\"fcb\">That is unlawful, misleading, discriminatory or fraudulent.\n<div class=\"mvm uiP fsm\"></div>\n</div>\n</li>\n<li>\n<div class=\"fcb\">That infringes or violates someone else\'s rights, including their intellectual property rights.</div>\n</li>\n</ul>\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>You may not upload viruses or malicious code, or do anything that could disable, overburden or impair the proper working or appearance of our Products.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>You may not access or collect data from our Products using automated means (without our prior permission) or attempt to access data that you do not have permission to access.</li>\n</ol>\n<div class=\"mvm uiP fsm\"></div>\nWe can remove or restrict access to content that is in violation of these provisions.\n<div class=\"mvm uiP fsm\"></div>\n<div class=\"mvm uiP fsm\"></div>\nIf we remove content that you have shared in violation of our Community Standards, we\'ll let you know and explain any options you have to request another review, unless you seriously or repeatedly violate these Terms or if doing so may expose us or others to legal liability; harm our community of users; compromise or interfere with the integrity or operation of any of our services, systems or Products; where we are restricted due to technical limitations; or where we are prohibited from doing so for legal reasons.\n<div class=\"mvm uiP fsm\"></div>\n<div class=\"mvm uiP fsm\"></div>\nTo help support our community, we encourage you toreportcontent or conduct that you believe violates your rights (includingintellectual property rights) or our terms and policies.\n<div class=\"mvm uiP fsm\"></div>\n<div class=\"mvm uiP fsm\"></div>\nWe also can remove or restrict access to your content, services or information if we determine that doing so is reasonably necessary to avoid or mitigate adverse legal or regulatory impacts to HebeKind.\n<div class=\"mvm uiP fsm\"></div>\n</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_j_mP\" class=\"_3ma\">3. The permissions you give us</div>\nWe need certain permissions from you to provide our services:<br />\n<ol>\n<ol>\n<li><u>Permission to use content that you create and share:</u>Some content that you share or upload, such as photos or videos, may be protected by intellectual property laws.\n<div class=\"mvm uiP fsm\"></div>\nYou own the intellectual property rights (things such as copyright or trademarks) in any such content that you create and share on HebeKind and otherHebeKind Company Productsyou use. Nothing in these Terms takes away the rights you have to your own content. You are free to share your content with anyone else, wherever you want.\n<div class=\"mvm uiP fsm\"></div>\nHowever, to provide our services, we need you to give us some legal permissions (known as a licence\') to use this content. This is solely for the purposes of providing and improving our Products and services as described in Section 1 above.\n<div class=\"mvm uiP fsm\"></div>\nSpecifically, when you share, post or upload content that is covered by intellectual property rights on or in connection with our Products, you grant us a non-exclusive, transferable, sub-licensable, royalty-free and worldwide licence to host, use, distribute, modify, run, copy, publicly perform or display, translate and create derivative works of your content (consistent with yourprivacyandapplicationsettings). This means, for example, that if you share a photo on HebeKind, you give us permission to store, copy and share it with others (again, consistent with your settings) such as service providers that support our service or other HebeKind Products you use. This licence will end when your content is deleted from our systems.\n<div class=\"mvm uiP fsm\"></div>\nYou can delete content individually or all at once by deleting your account.Learn moreabout how to delete your account. You candownload a copyof your data at any time before deleting your account.\n<div class=\"mvm uiP fsm\"></div>\nWhen you delete content, it\'s no longer visible to other users; however, it may continue to exist elsewhere on our systems where:\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">Immediate deletion is not possible due to technical limitations (in which case, your content will be deleted within a maximum of 90 days from when you delete it);</div>\n</li>\n<li>\n<div class=\"fcb\">your content has been used by others in accordance with this licence and they have not deleted it (in which case, this licence will continue to apply until that content is deleted); or</div>\n</li>\n<li>\n<div class=\"fcb\">Where immediate deletion would restrict our ability to:\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">investigate or identify illegal activity or breaches of our Terms and Policies (for example, to identify or investigate misuse of our Products or systems);</div>\n</li>\n<li>\n<div class=\"fcb\">comply with a legal obligation, such as the preservation of evidence; or</div>\n</li>\n<li>\n<div class=\"fcb\">comply with a request of a judicial or administrative authority, law enforcement or a government agency;</div>\n</li>\n</ul>\n</div>\n</li>\n</ul>\n</li>\n</ol>\n</ol>\n<div class=\"mvm uiP fsm\"></div>\n<ol>\n<ol>in which case, the content will be retained for no longer than is necessary for the purposes for which it has been retained (the exact duration will vary on a case-by-case basis).</ol>\n</ol>\n<div class=\"mvm uiP fsm\"></div>\n<div class=\"mvm uiP fsm\"></div>\n<ol>\n<ol>In each of the above cases, this licence will continue until the content has been fully deleted.</ol>\n</ol>\n<div class=\"mvm uiP fsm\"></div>\n<ol>\n<li><u>Permission to use your name, profile picture and information about your actions with ads and sponsored content:</u>You give us permission to use your name and profile picture and information about actions that you have taken on HebeKind next to or in connection with ads, offers and other sponsored content that we display across our Products, without any compensation to you. For example, we may show your friends that you are interested in an advertised event or have liked a HebeKind Page created by a brand that has paid us to display its ads on HebeKind. Ads like this can be seen only by people who have your permission to see the actions that you\'ve taken on HebeKind Products. You canlearn moreabout your ad settings and preferences.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li><u>Permission to update software that you use or download:</u>If you download or use our software, you give us permission to download and install updates to the software where available.</li>\n</ol>\n</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_k_NB\" class=\"_3ma\">4. Limits on using our intellectual property</div>\nIf you use content covered by intellectual property rights that we have and make available in our Products (for example, images, designs, videos or sounds that we provide, which you add to content that you create or share on HebeKind), we retain all rights to that content (but not yours). You can only use our copyrights ortrademarks (or any similar marks)as expressly permitted by ourBrand Usage Guidelinesor with our prior written permission. You must obtain our written permission (or permission under an open-source licence) to modify, create derivative works of, decompile or otherwise attempt to extract source code from us.</div>\n</div>\n</div>\n<div id=\"u_0_l_dJ\" class=\"_3x93 _1-qu _52ii _3m9\">\n<div id=\"u_0_m_3B\" class=\"_t3o\">\n<div class=\"_17l6 _1-xl _17la\"></div>\n<div class=\"_t3q\"></div>\n</div>\n<h3 class=\"_3x94 _52io _3m9\">4. Additional provisions</h3>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_n_mK\" class=\"_3ma\">1. Updating our Terms</div>\nWe work constantly to improve our services and develop new features to make our Products better for you and our community. As a result, we may need to update these Terms from time to time to accurately reflect our services and practices. We will only make changes if the provisions are no longer appropriate or if they are incomplete, and only if the changes are reasonable and take due account of your interests.\n<div class=\"mvm uiP fsm\"></div>\nWe will notify you (for example, by email or through our Products) at least 30 days before we make changes to these Terms and give you an opportunity to review them before they go into effect, unless changes are required by law. Once any updated Terms are in effect, you will be bound by them if you continue to use our Products.\n<div class=\"mvm uiP fsm\"></div>\nWe hope that you will continue using our Products, but if you do not agree to our updated Terms and no longer want to be a part of the HebeKind community, you candeleteyour account at any time.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_o_jN\" class=\"_3ma\">2. Account suspension or termination</div>\n<a id=\"account-termination\" href=\"https://www.facebook.com/legal/terms?cquick=jsc_c_p&amp;cquick_token=AQ53IPuei-QF4e5oXfw&amp;ctarget=https%3A%2F%2Fwww.facebook.com\"></a>We want HebeKind to be a place where people feel welcome and safe to express themselves and share their thoughts and ideas.\n<div class=\"mvm uiP fsm\"></div>\nIf we determine that you have clearly, seriously or repeatedly breached our Terms or Policies, including in particular our Community Standards, we may suspend or permanently disable access to your account. We may also suspend or disable your account if you repeatedly infringe other people\'s intellectual property rights or where we are required to do so for legal reasons.\n<div class=\"mvm uiP fsm\"></div>\nWhere we take such action, we\'ll let you know and explain any options you have to request a review, unless doing so may expose us or others to legal liability; harm our community of users; compromise or interfere with the integrity or operation of any of our services, systems or Products; or where we are restricted due to technical limitations; or where we are prohibited from doing so for legal reasons.\n<div class=\"mvm uiP fsm\"></div>\nYou canlearn moreabout what you can do if your account has been disabled and how to contact us if you think that we have disabled your account by mistake.\n<div class=\"mvm uiP fsm\"></div>\nIf you delete or we disable your account, these Terms shall terminate as an agreement between you and us, but the following provisions will remain in place: 3, 4.2-4.5.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_p_bZ\" class=\"_3ma\">3. Limits on liability</div>\nWe work hard to provide the best Products we can and to specify clear guidelines for everyone who uses them. Our Products, however, are provided \"as is\", and we make no guarantees that they will always be safe, secure or error-free, or that they will function without disruptions, delays or imperfections. To the extent permitted by law, we also DISCLAIM ALL WARRANTIES, WHETHER EXPRESS OR IMPLIED, INCLUDING THE IMPLIED WARRANTIES OF MERCHANTABILITY, FITNESS FOR A PARTICULAR PURPOSE, TITLE AND NON-INFRINGEMENT. We do not control or direct what people and others do or say, and we are not responsible for their actions or conduct (whether online or offline) or any content that they share (including offensive, inappropriate, obscene, unlawful and other objectionable content).\n<div class=\"mvm uiP fsm\"></div>\nWe cannot predict when issues may arise with our Products. Accordingly, our liability shall be limited to the fullest extent permitted by applicable law, and under no circumstances will we be liable to you for any lost profits, revenues, information or data, or consequential, special, indirect, exemplary, punitive or incidental damages arising out of or related to these Terms or the HebeKind Products, even if we have been advised of the possibility of such damages.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_q_uO\" class=\"_3ma\">4. Disputes</div>\nWe try to provide clear rules so that we can limit or hopefully avoid disputes between you and us. If a dispute does arise, however, it\'s useful to know upfront where it can be resolved and what laws will apply.\n<div class=\"mvm uiP fsm\"></div>\nIf you are a consumer, the laws of the country in which you reside will apply to any claim, cause of action or dispute that you have against us that arises out of or relates to these Terms or the HebeKind Products, and you may resolve your claim in any competent court in that country that has jurisdiction over the claim. In all other cases, you agree that the claim must be resolved exclusively in the US. District Court for the Northern District of California or a state court located in San Mateo County. You also agree that you submit to the personal jurisdiction of either of these courts for the purpose of litigating any such claim, and that the laws of the State of California will govern these Terms and any claim, without regard to conflict of law provisions.</div>\n</div>\n<div class=\"_xpp\">\n<div class=\"_xpq\"></div>\n<div class=\"_xpr\">\n<div id=\"u_0_r_cI\" class=\"_3ma\">5. Other</div>\n<ol>\n<li>These Terms (formerly known as the Statement of Rights and Responsibilities) make up the entire agreement between you and HebeKind Platforms, Inc. regarding your use of our Products. They supersede any prior agreements.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>Some of the Products that we offer are also governed by supplemental Terms. If you use any of those Products, supplemental terms will be made available and will become part of our agreement with you. For instance, if you access or use our Products for commercial or business purposes, such as buying ads, selling products, developing apps, managing a group or Page for your business, or using our measurement services, you must agree to ourCommercial Terms. If you post or share content containing music, you must comply with ourMusic Guidelines. To the extent that any supplemental Terms conflict with these Terms, the supplemental Terms shall govern to the extent of the conflict.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>If any portion of these Terms is found to be unenforceable, the remaining portion will remain in full force and effect. If we fail to enforce any of these Terms, it will not be considered a waiver. Any amendment to or waiver of these Terms must be made in writing and signed by us.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>You will not transfer any of your rights or obligations under these Terms to anyone else without our consent.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>You may designate a person (called a legacy contact) to manage your account if it is memorialised. Only your legacy contact or a person who you have identified in a valid will or similar document expressing clear consent to disclose your content upon death or incapacity will be able to seekdisclosurefrom your account after it is memorialised.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>These Terms do not confer any third-party beneficiary rights. All of our rights and obligations under these Terms are freely assignable by us in connection with a merger, acquisition or sale of assets, or by operation of law or otherwise.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>You should know that we may need to change the username for your account in certain circumstances (for example, if someone else claims the username and it appears unrelated to the name that you use in everyday life). We will inform you in advance if we have to do this and explain why.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>We always appreciate your feedback and other suggestions about our products and services. But you should know that we may use them without any restriction or obligation to compensate you, and we are under no obligation to keep them confidential.\n<div class=\"mvm uiP fsm\"></div>\n</li>\n<li>We reserve all rights not expressly granted to you.</li>\n</ol>\n</div>\n</div>\n</div>\n<div id=\"u_0_s_eN\" class=\"_3x93 _1-r8 _52ii _3m9\">\n<div id=\"u_0_t_as\" class=\"_t3o\">\n<div class=\"_17l6 _1-xl _17la\"></div>\n<div class=\"_t3q\"></div>\n</div>\n<h3 class=\"_3x94 _52io _3m9\">5. Other Terms and Policies that may apply to you</h3>\n<a id=\"other-terms-policies\" href=\"https://www.facebook.com/legal/terms?cquick=jsc_c_p&amp;cquick_token=AQ53IPuei-QF4e5oXfw&amp;ctarget=https%3A%2F%2Fwww.facebook.com\"></a>\n<ul class=\"uiList _4of _4kg\">\n<li>\n<div class=\"fcb\">Community Standards: These guidelines outline our standards regarding the content that you post to HebeKind and your activity on HebeKind and other HebeKind Products.</div>\n</li>\n<li>\n<div class=\"fcb\">Commercial Terms: These Terms apply if you also access or use our Products for any commercial or business purpose, including advertising, operating an app on our Platform, using our measurement services, managing a group or a Page for a business, or selling goods or services.</div>\n</li>\n<li>\n<div class=\"fcb\">Advertising Policies: These policies specify what types of ad content are allowed by partners who advertise across the HebeKind Products.</div>\n</li>\n<li>\n<div class=\"fcb\">Self-serve Ad Terms: These Terms apply when you use self-serve advertising interfaces to create, submit or deliver advertising or other commercial or sponsored activity or content.</div>\n</li>\n<li>\n<div class=\"fcb\">HebeKind Pages, Groups and Events Policy: These guidelines apply if you create or administer a HebeKind Page, group or event, or if you use HebeKind to communicate or administer a promotion.</div>\n</li>\n<li>\n<div class=\"fcb\"><a href=\"https://developers.facebook.com/policy/\">HebeKind Platform Terms</a>: These guidelines outline the Policies that apply to your use of our platform (for example, for developers or operators of a platform application or website or if you use social plugins).</div>\n</li>\n<li>\n<div class=\"fcb\">Developer Payment Terms: These Terms apply to developers of applications that use HebeKind Payments.</div>\n</li>\n<li>\n<div class=\"fcb\">Community Payment Terms: These terms apply to payments made on or through HebeKind Products.</div>\n</li>\n<li>\n<div class=\"fcb\">Commerce Policies: These guidelines outline the Policies that apply when you offer products and services for sale on HebeKind.</div>\n</li>\n<li>\n<div class=\"fcb\">HebeKind brand resources: These guidelines outline the policies that apply to use of HebeKind trademarks, logos and screenshots.</div>\n</li>\n<li>\n<div class=\"fcb\">Music guidelines: These guidelines outline the policies that apply if you post or share content containing music on HebeKind Products.\n<div class=\"mvm uiP fsm\"></div>\n</div>\n</li>\n<li>\n<div class=\"fcb\">Live Policies: These policies apply to all content broadcast to HebeKind Live.</div>\n</li>\n</ul>\n</div>"),
("2","privacy_policy","<h2>Who we are?</h2>\n<p>Provide name and contact details of the data controller. This will typically be your business or you, if you are a sole trader. Where applicable, you should include the identity and contact details of the controllers representative and/or the data protection officer.</p>\n<h2>What information do we collect?</h2>\n<p>Specify the types of personal information you collect, eg names, addresses, user names, etc. You should include specific details on: how you collect data (eg when a user registers, purchases or uses your services, completes a contact form, signs up to a newsletter, etc) what specific data you collect through each of the data collection method if you collect data from third parties, you must specify categories of data and source if you process sensitive personal data or financial information, and how you handle this <br /><br /> You may want to provide the user with relevant definitions in relation to personal data and sensitive personal data. <br /><br /></p>\n<h2>How do we use personal information?</h2>\n<p>Describe in detail all the service- and business-related purposes for which you will process data. For example, this may include things like: personalisation of content, business information or user experience account set up and administration delivering marketing and events communication carrying out polls and surveys internal research and development purposes providing goods and services legal obligations (eg prevention of fraud) meeting internal audit requirements <br /><br /> Please note this list is not exhaustive. You will need to record all purposes for which you process personal data. <br /><br /></p>\n<h2>What legal basis do we have for processing your personal data?</h2>\n<p>Describe the relevant processing conditions contained within the GDPR. There are six possible legal grounds: consent contract legitimate interests vital interests public task legal obligation <br /><br /> Provide detailed information on all grounds that apply to your processing, and why. If you rely on consent, explain how individuals can withdraw and manage their consent. If you rely on legitimate interests, explain clearly what these are. <br /><br /> If youre processing special category personal data, you will have to satisfy at least one of the six processing conditions, as well as additional requirements for processing under the GDPR. Provide information on all additional grounds that apply. <br /><br /></p>\n<h2>When do we share personal data?</h2>\n<p>Explain that you will treat personal data confidentially and describe the circumstances when you might disclose or share it. Eg, when necessary to provide your services or conduct your business operations, as outlined in your purposes for processing. You should provide information on: how you will share the data what safeguards you will have in place what parties you may share the data with and why</p>\n<h2>Where do we store and process personal data?</h2>\n<p>If applicable, explain if you intend to store and process data outside of the data subjects home country. Outline the steps you will take to ensure the data is processed according to your privacy policy and the applicable law of the country where data is located. If you transfer data outside the European Economic Area, outline the measures you will put in place to provide an appropriate level of data privacy protection. Eg contractual clauses, data transfer agreements, etc.</p>\n<h2>How do we secure personal data?</h2>\n<p>Describe your approach to data security and the technologies and procedures you use to protect personal information. For example, these may be measures: to protect data against accidental loss to prevent unauthorised access, use, destruction or disclosure to ensure business continuity and disaster recovery to restrict access to personal information to conduct privacy impact assessments in accordance with the law and your business policies to train staff and contractors on data security to manage third party risks, through use of contracts and security reviews <br /><br /> Please note this list is not exhaustive. You should record all mechanisms you rely on to protect personal data. You should also state if your organisation adheres to certain accepted standards or regulatory requirements. <br /><br /></p>\n<h2>How long do we keep your personal data for?</h2>\n<p>Provide specific information on the length of time you will keep the information for in relation to each processing purpose. The GDPR requires you to retain data for no longer than reasonably necessary. Include details of your data or records retention schedules, or link to additional resources where these are published. <br /><br /> If you cannot state a specific period, you need to set out the criteria you will apply to determine how long to keep the data for (eg local laws, contractual obligations, etc) <br /><br /> You should also outline how you securely dispose of data after you no longer need it. <br /><br /></p>\n<h2>Your rights in relation to personal data</h2>\n<p>Under the GDPR, you must respect the right of data subjects to access and control their personal data. In your privacy notice, you must outline their rights in respect of: access to personal information correction and deletion withdrawal of consent (if processing data on condition of consent) data portability restriction of processing and objection lodging a complaint with the Information Commissioners Office You should explain how individuals can exercise their rights, and how you plan to respond to subject data requests. State if any relevant exemptions may apply and set out any identity verifications procedures you may rely on. Include details of the circumstances where data subject rights may be limited, eg if fulfilling the data subject request may expose personal data about another person, or if youre asked to delete data which you are required to keep by law.</p>\n<h2>Use of automated decision-making and profiling</h2>\n<p>Where you use profiling or other automated decision-making, you must disclose this in your privacy policy. In such cases, you must provide details on existence of any automated decision-making, together with information about the logic involved, and the likely significance and consequences of the processing of the individual.</p>\n<h2>How to contact us?</h2>\n<p>Explain how data subject can get in touch if they have questions or concerns about your privacy practices, their personal information, or if they wish to file a complaint. Describe all ways in which they can contact you  eg online, by email or postal mail. <br /><br /> If applicable, you may also include information on: <br /><br /></p>\n<h2>Use of cookies and other technologies</h2>\n<p>You may include a link to further information, or describe within the policy if you intend to set and use cookies, tracking and similar technologies to store and manage user preferences on your website, advertise, enable content or otherwise analyse user and usage data. Provide information on what types of cookies and technologies you use, why you use them and how an individual can control and manage them. <br /><br /> Linking to other websites / third party content If you link to external sites and resources from your website, be specific on whether this constitutes endorsement, and if you take any responsibility for the content (or information contained within) any linked website. <br /><br /> You may wish to consider adding other optional clauses to your privacy policy, depending on your business circumstances.</p>"),
